import React from "react";
import { FetchAllPlayers } from "./Create.js";
import  AllPuppies  from "./Cards"

const puppies = [{id: 9989, name: 'Rex', breed: 'Shiba Inu', status: 'bench', imageUrl: 'https://images.pexels.com/photos/1805164/pexels-photo-1805164.jpeg?auto=compress&cs=tinysrgb&w=400'},
{id: 9989, name: 'some', breed: 'Shiba Inu', status: 'bench', imageUrl: 'https://images.pexels.com/photos/1805164/pexels-photo-1805164.jpeg?auto=compress&cs=tinysrgb&w=400'}
]

export const Main = async () => {
    const players = await FetchAllPlayers();
    return(
        <div>
            <h1>Welcome to Puppy Bowl</h1>
            <div id = "navbar"></div>
            <div>
            <AllPuppies puppies = {players}/>
            </div>
        </div>
    );
};
main()
